member.remarks:
A numbering level definition is identical to a numbering level override definition, 
except for the fact that it is defined as part of a numbering definition instance using the  abstractNum element (17.9.1) 
rather than as part of an abstract numbering definition using the num element (17.9.15).

member.summary:
Specifies that the contents of this run shall be displayed as if each character has a shadow. 
For left-to-right text, the shadow is beneath the text and to its right; 
for right-to-left text, the shadow is beneath the text and to its left..

Specifies that the parent table cell shall be treated as though it was deleted from the document 
while revisions were being recorded. This means that although the table cell element exists in the structure of the table, 
the table cell technically no longer exists in the document.

This element specifies the phantom object. This object has two primary uses: 
adding the spacing of the phantom base element e without displaying that base; 
and suppressing part of the glyph for spacing considerations.
